import React from "react";
import '../stylesheets/Footer.css';

class Footer extends React.Component {
    render(){
        return(
        <footer id="about">
            <header>About</header>
                <h1>About Us</h1>
                <p>We connect talented freelancers with clients worldwide — from design to development, video editing to marketing. Whether you're here to hire or get hired, we make it simple, secure, and professional.</p>
                <p>Your go-to platform for hiring top freelancers and finding quality gigs — fast, easy, and secure.</p>
    </footer>
            )
    }
}
export default Footer;
